import React, { Component } from 'react';

export default class BtnMoneyBack extends Component {

	moneyBack() {
		alert("hello");
	}
	render(){
		const {lastPurchased, moneyBack, money} = this.props; 


		return (

			lastPurchased || money ? <button onClick={moneyBack} className="btn btn-info">
				Obtener cambio </button> : <button className="btn btn-info" disabled>No tienes cambio</button>  
		)
	} 
}
